// Import core styling and dependencies
import "bootstrap/dist/css/bootstrap.min.css";
import React from "react";
import ReactDOM from "react-dom/client";

// Import global styles and your main app
import "./index.css";
import App from "./App";

// Optional: Suppress noisy ResizeObserver warning in development only
// This prevents "ResizeObserver loop completed with undelivered notifications"
// from cluttering your console when showing/hiding dynamic fields
if (process.env.NODE_ENV === "development") {
  const originalConsoleError = console.error;
  console.error = (...args) => {
    if (
      typeof args[0] === "string" &&
      args[0].includes("ResizeObserver loop")
    ) {
      return; // Silently ignore this specific warning
    }
    originalConsoleError(...args); // Let all other errors through
  };
}

// Mount your app using React 18+ root API
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
